import React from "react";
import "../Styles/Home.css";
import { about_us } from "../Images/about_us.jpg";

function Home() {
  return (
    <div>
      <div className="about-us">
        <img src="about_us" alt="About Us Image Loading..."></img>
      </div>
    </div>
  );
}

export default Home;
